function ItemListContainer({ greeting }) {
  return (
    <div style={{ padding: '20px' }}>
      <h2>{greeting}</h2>
      <p>Aquí irá el catálogo de productos próximamente.</p>
    </div>
  );
}

export default ItemListContainer;
